import { StyleSheet } from "react-native";

import { Colors } from "../../colors";

export default StyleSheet.create({
  header: {
    shadowColor: "transparent",
    elevation: 0,
    shadowRadius: 0,
    shadowOffset: {
      width: 0,
      height: 0,
    },
    backgroundColor: Colors.white,
    height: 36,
  },
});
